// 해당 위치에 필요한 컴포넌트를 바탕으로 직접 Bootstrap Album 페이지를 개발하시면 됩니다.
import Top from "./component/Top/Top";
import React from "react";
import { GlobalStyle } from "./component/Styled/Styled";
import Box from "./component/Box/Box";


function App() {
  return <> 
  <GlobalStyle/>
    <Top text="Album"/>
    <Box Text="This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer." BtnText1="View"></Box>
  </>;


};


export default App;
